INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-416.5, 3.414, 1000001, "2025/01/31 12:00:00", 1, 1, "カリン", 0.0, 190801, 62, "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 2, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-416.5, 3.099, 1000002, "2025/01/31 12:00:00", 2, 1, "カリン", 0.0, 190801, 62, "ミッションをクリアして、\n報酬をゲットしましょう！", 2, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-416.5, 2.801, 1000003, "2025/01/31 12:00:00", 3, 1, "カリン", 0.0, 190801, 63, "受け取ることができる\n報酬があるようです\n確認してみてください", 2, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-416.5, 0.0, 1000004, "2025/01/31 12:00:00", 4, 1, "カリン", 0.0, 190801, 63, "報酬がもらえますよ！\nチェックしてみてください", 2, "2030/01/01 14:59:59", 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-363.0, 2.12, 1000005, "2025/01/31 12:00:00", 5, 1, "カリン", 0.0, 190801, 64, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 1, "2030/01/01 14:59:59", 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-363.0, 1.68, 1000006, "2025/01/31 12:00:00", 6, 1, "カリン", 0.0, 190801, 64, "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 2, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-363.0, 2.33, 1000007, "2025/01/31 12:00:00", 7, 1, "カリン", 0.0, 190801, 64, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 1, "2030/01/01 14:59:59", 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 5.18, 1020101, "2025/01/31 12:00:00", 101, 10201, "ラビリスタ", -6.0, 133701, 61, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 7, "2030/01/01 14:59:59", 3);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 8.77, 1020102, "2025/01/31 12:00:00", 201, 10201, "クリスティーナ", -2.0, 133901, 61, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 2, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 15.5, 1020103, "2025/01/31 12:00:00", 301, 10201, "ネネカ", 0.0, 133801, 61, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 1, "2030/01/01 14:59:59", 6);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 9.061, 1020201, "2025/02/28 12:00:00", 101, 10202, "ランファ", 0.0, 134301, 61, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 5, "2030/01/01 14:59:59", 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 7.699, 1020202, "2025/02/28 12:00:00", 201, 10202, "チカ", 0.0, 134401, 61, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 2, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 8.595, 1020301, "2025/03/31 12:00:00", 101, 10203, "アオイ", 0.0, 134601, 61, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 2, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 7.758, 1020302, "2025/03/31 12:00:00", 201, 10203, "クローチェ", 0.0, 134501, 61, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 2, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 7.0, 1020401, "2025/04/30 12:00:00", 101, 10204, "ルイズマリー", 0.0, 132302, 61, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 6, "2030/01/01 14:59:59", 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 7.904, 1020402, "2025/04/30 12:00:00", 201, 10204, "イロハ", 0.0, 132402, 61, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 2, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 8.487, 1020403, "2025/04/30 12:00:00", 301, 10204, "ソノ", 0.0, 132502, 61, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 2, "2030/01/01 14:59:59", 4);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 8.763, 1020502, "2025/05/31 12:00:00", 101, 10205, "カノン", 0.0, 134901, 61, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 2, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 6.417, 1020503, "2025/05/31 12:00:00", 201, 10205, "ツムギ", 0.0, 134801, 61, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 3, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 10.335, 1020601, "2025/06/30 12:00:00", 101, 10206, "エリス", 0.0, 135001, 61, "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 7, "2030/01/01 14:59:59", 3);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 6.281, 1020602, "2025/06/30 12:00:00", 201, 10206, "シェフィ", 0.0, 135101, 61, "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 4, "2030/01/01 14:59:59", 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 12.244, 1020603, "2025/06/30 12:00:00", 301, 10206, "プレシア", 0.0, 135201, 61, "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 2, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 6.339, 1020701, "2025/07/31 12:00:00", 101, 10207, "クリア", 0.0, 135301, 61, "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", 8, "2030/01/01 14:59:59", 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 8.184, 1020702, "2025/07/31 12:00:00", 201, 10207, "アネモネ", 0.0, 135401, 61, "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", 9, "2030/01/01 14:59:59", 7);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 3.906, 1020801, "2025/08/31 12:00:00", 101, 10208, "アイラ", 0.0, 129101, 61, "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", 2, "2030/01/01 14:59:59", 9);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 14.465, 1020802, "2025/08/31 12:00:00", 201, 10208, "シナツ", 0.0, 129201, 61, "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", 2, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 8.662, 1020803, "2025/08/31 12:00:00", 301, 10208, "ヒヨリ", 0.0, 100101, 61, "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", 3, "2030/01/01 14:59:59", 4);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 10.915, 1020804, "2025/08/31 12:00:00", 401, 10208, "レイ", 0.0, 100301, 61, "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", 3, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 6.042, 1020901, "2025/09/30 12:00:00", 101, 10209, "ユキノ", 0.0, 135802, 61, "あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…", 7, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 9.402, 1020902, "2025/09/30 12:00:00", 201, 10209, "サツキ", 0.0, 135903, 61, "なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公", 1, "2030/01/01 14:59:59", 4);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 8.16, 1020903, "2025/09/30 12:00:00", 301, 10209, "ルルィ", 0.0, 136902, 61, "う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい", 1, "2030/01/01 14:59:59", 8);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 5.0, 1021001, "2025/10/31 12:00:00", 101, 10210, "カスミ", 0.0, 137401, 61, "ひさしぶりのジオ・ゲヘナ\n歓迎パーティーで起きた殺人事件！\nランドソルの名探偵の名にかけて\n解き明かしてみせようじゃないか！", 2, "2030/01/01 14:59:59", 3);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 8.12, 1021002, "2025/10/31 12:00:00", 201, 10210, "アラクネ", 0.0, 136001, 61, "…わたしはどこの誰なのでしょう\nどこから来てどこへ行くのでしょう\nこの事件の真相が分かれば、\n何かが掴めるような気がいたします", 1, "2030/01/01 14:59:59", 4);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 6.386, 1021003, "2025/10/31 12:00:00", 301, 10210, "ナーナ", 0.0, 136202, 61, "ナーナ、すいりとかろんぱとか、\nむずかしくてわかんないけど…\nお友だちとドーナツのためならっ\nせーいっぱいがんばるよっ！", 2, "2030/01/01 14:59:59", 4);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 7.438, 1021101, "2025/11/30 12:00:00", 101, 10211, "ユイ", 0.0, 136402, 61, "騎士クンに想いを伝えたい…だから\nミソラちゃん、わたしがんばるね！\n…あれ？　わたし、なんでこんなに\n必死になってるんだろう…？", 4, "2030/01/01 14:59:59", 3);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 8.35, 1021102, "2025/11/30 12:00:00", 201, 10211, "ミソラ", 0.0, 136302, 61, "騎士さんとのデートはわたしに\nお任せです★　なのでユイさんは\n安心して計画に専念して…たくさん\nドキドキしちゃってくださいね", 5, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 5.0, 1021201, "2025/12/31 12:00:00", 101, 10212, "シズル", 0.0, 136501, 61, "新しい年がやってくるね！\nお正月の料理も飾りつけも、\nお姉ちゃんにお任せだよ♪\nみんなで楽しく新年を迎えよう！", 2, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 5.25, 1021202, "2025/12/31 12:00:00", 201, 10212, "リノ", 0.0, 137902, 61, "おうちの掃除もトラブルも、 \n世界を揺るがす大ピンチも！\n今年のことは今年のうちに \nサッサと片付けちゃいますっ！", 2, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 7.5, 1021203, "2025/12/31 12:00:00", 301, 10212, "ラビリスタ", 0.0, 106801, 61, "年の瀬はギルドマスターも\nつい駆け回っちゃう忙しい時期だ！\n一年いろいろあったけど\nお互いイイ年を迎えよう、少年！", 2, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 8.204, 1021301, "2026/01/31 12:00:00", 101, 10213, "ライラエル", 0.0, 126501, 61, "漂う異国の料理の香り…それだけで\n世界中を旅した気分に浸れますね\nふふ、ほらクローチェ\nあまりはしゃぎすぎないように…♪", 2, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 7.176, 1021302, "2026/01/31 12:00:00", 201, 10213, "ネフィ＝ネラ", 0.0, 129701, 61, "異界の姫君と煮炊きにて競い合う…\n感奮興起、いとをかし\n華やかなる祭典と相成るよう、一肌\n脱がせていただきとう存じまする", 2, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 8.602, 1021303, "2026/01/31 12:00:00", 301, 10213, "ヴァイオレット", 0.0, 133101, 61, "『ビストロプリンセス』のために\n料理の特訓を重ねてまいりました\nこの料理で騎士様の…い、いえ\n皆様の心とお腹を満たしますわ！", 5, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 10.14, 1021304, "2026/02/06 12:00:00", 102, 10213, "ライラエル", 0.0, 138101, 61, "多様な味わいが織りなすハーモニー\nそれこそが我が国の矜持です\nもしもそれを乱すようであれば\nわたしも優しくはありませんよ？", 3, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 10.152, 1021305, "2026/02/06 12:00:00", 202, 10213, "ネフィ＝ネラ", 0.0, 138201, 61, "煉獄の穢土にてひと際輝く民草の心\n此れを守護りまするがわっちの責務\n如何な困難待ち受けようと\n不退転の矜持に揺らぎはありんせん", 7, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 9.688, 1021306, "2026/02/06 12:00:00", 302, 10213, "ヴァイオレット", 0.0, 138001, 61, "裏世界の皆様は危機を脱し、\n残るはランドソルの皆様のみ…\n彼らを救い出すために、どうか…\nお立ち下さいペコリーヌ姫…！", 3, "2030/01/01 14:59:59", 4);
